package com.tny.game.suite.login;

import com.fasterxml.jackson.annotation.*;
import com.tny.game.protoex.annotations.*;
import com.tny.game.suite.*;
import org.apache.commons.lang3.StringUtils;

@JsonAutoDetect(getterVisibility = JsonAutoDetect.Visibility.NONE,
        isGetterVisibility = JsonAutoDetect.Visibility.NONE)
@ProtoEx(SuiteProtoIDs.AUTH_$GAMES_TICKET)
public class GameTicket {

    @JsonProperty
    @ProtoExField(1)
    private String pf;

    @JsonProperty
    @ProtoExField(2)
    private String ad;

    @JsonProperty
    @ProtoExField(3)
    private int server;

    @JsonProperty
    @ProtoExField(4)
    private long zone;

    @JsonProperty
    @ProtoExField(5)
    private int entry;

    @JsonProperty
    @ProtoExField(6)
    private String device;

    @JsonProperty
    @ProtoExField(7)
    private String openId;

    @JsonProperty
    @ProtoExField(8)
    private String openKey;

    @JsonProperty
    @ProtoExField(9)
    private long time;

    @JsonProperty
    @ProtoExField(10)
    private String pwdKey;

    @JsonProperty
    @ProtoExField(11)
    private String secret;

    @JsonProperty
    @ProtoExField(12)
    private long tokenId;

    @JsonProperty
    @ProtoExField(14)
    private boolean interior = false;

    @JsonProperty
    @ProtoExField(15)
    private String deviceId;

    @JsonProperty
    @ProtoExField(16)
    private String accountTag;

    @JsonProperty
    @ProtoExField(17)
    private String bindId;

    @JsonProperty
    @ProtoExField(18)
    private boolean guest;

    @JsonProperty
    @ProtoExField(19)
    private String lang;

    public GameTicket() {
        super();
    }

    public GameTicket(long tokenId, int server, String openId, String bindId, boolean guest, String openKey,
            String lang, String pf, String accountTag, long zone, int entry, String device, String deviceId, long time,
            TicketMaker<GameTicket> maker) {
        this(tokenId, server, openId, bindId, guest, false, openKey, lang, pf, accountTag, zone, entry, device, deviceId, time, maker);
    }

    public GameTicket(long tokenId, int server, String openId, String bindId, boolean guest, boolean interior, String openKey,
            String lang, String pf, String accountTag, long zone, int entry, String device, String deviceId, long time,
            TicketMaker<GameTicket> maker) {
        super();
        this.tokenId = tokenId;
        this.openId = openId;
        this.bindId = bindId;
        this.guest = guest;
        this.openKey = openKey;
        this.server = server;
        this.time = time;
        this.pf = pf;
        this.accountTag = accountTag;
        this.zone = zone;
        this.entry = entry;
        this.device = StringUtils.isBlank(deviceId) ? "NONE" : device;
        this.deviceId = StringUtils.isBlank(deviceId) ? openId : deviceId;
        this.interior = interior;
        this.lang = lang;
        if (maker != null)
            this.secret = maker.make(this);
    }

    public String getPf() {
        return this.pf;
    }

    public String getAd() {
        return this.ad;
    }

    public int getServer() {
        return this.server;
    }

    public long getZone() {
        return this.zone;
    }

    public int getEntry() {
        return this.entry;
    }

    public String getDevice() {
        return this.device;
    }

    public String getDeviceId() {
        return this.deviceId;
    }

    public String getOpenId() {
        return this.openId;
    }

    public String getOpenKey() {
        return this.openKey;
    }

    public long getTime() {
        return this.time;
    }

    public String getPwdKey() {
        return this.pwdKey;
    }

    public String getSecret() {
        return this.secret;
    }

    public long getTokenId() {
        return this.tokenId;
    }

    public String getAccountTag() {
        return accountTag;
    }

    public String getBindId() {
        return bindId == null ? openId : bindId;
    }

    public String getLang() {
        return lang;
    }

    public boolean isInterior() {
        return this.interior;
    }

    public boolean isGuest() {
        return guest;
    }

    GameTicket setZone(long zone) {
        this.zone = zone;
        return this;
    }

    GameTicket setDeviceId(String deviceID) {
        this.deviceId = deviceID;
        return this;
    }

    GameTicket setBindId(String bindId) {
        this.bindId = bindId;
        return this;
    }

    GameTicket setGuest(boolean guest) {
        this.guest = guest;
        return this;
    }

    GameTicket setPf(String pf) {
        this.pf = pf;
        return this;
    }

    GameTicket setAd(String ad) {
        this.ad = ad;
        return this;
    }

    GameTicket setServer(int server) {
        this.server = server;
        return this;
    }

    GameTicket setZone(int zone) {
        this.zone = zone;
        return this;
    }

    GameTicket setEntry(int entry) {
        this.entry = entry;
        return this;
    }

    GameTicket setDevice(String device) {
        this.device = device;
        return this;
    }

    GameTicket setOpenId(String openId) {
        this.openId = openId;
        return this;
    }

    GameTicket setOpenKey(String openKey) {
        this.openKey = openKey;
        return this;
    }

    GameTicket setTime(long time) {
        this.time = time;
        return this;
    }

    GameTicket setPwdKey(String pwdKey) {
        this.pwdKey = pwdKey;
        return this;
    }

    GameTicket setSecret(String secret) {
        this.secret = secret;
        return this;
    }

    GameTicket setTokenId(long tokenId) {
        this.tokenId = tokenId;
        return this;
    }

    GameTicket setAccountTag(String accountTag) {
        this.accountTag = accountTag;
        return this;
    }

    GameTicket setInterior(boolean interior) {
        this.interior = interior;
        return this;
    }

    GameTicket setLang(String lang) {
        this.lang = lang;
        return this;
    }

    @Override
    public String toString() {
        return "GamesTicket [pf=" + this.pf + ", ad=" + this.ad + ", server=" + this.server + ", zone=" + this.zone + ", entry=" + this.entry +
               ", device=" + this.device + ", openId=" + this.openId
               + ", openKey=" + this.openKey + ", time="
               + this.time + ", pwdKey=" + this.pwdKey + ", secret=" + this.secret + "]";
    }

    public static void main(String[] args) {
        String value1
                = "";
        String value2
                = "";
        System.out.println(value1.equals(value2));
    }

}
